/* eslint-disable react/prop-types */
import React, { useState } from "react"
import ItemCard from "../components/ItemCard"
import { Dropdown, Form, FormControl, InputGroup } from "react-bootstrap"

const verbandPlaceholder = {
    image: 'data:image/jpeg;base64,',
    name: 'Aluderm compresses 10x10cm',
    minAmount: 100,
    id: '22000022',
}

const otherPlaceholder = {
    image: 'data:image/webp;base64,',
    name: 'ES-Compresses 10x10cm',
    minAmount: 100,
    id: '22000023',
}

const verbandItemA = {
    placeholderID: '22000022',
    amount: 5,
    expirationDate: '2024-03-22'
}

const verbandItemB = {
    placeholderID: '22000022',
    amount: 2,
    expirationDate: '2024-04-22'
}

const verbandItemC = {
    placeholderID: '22000022',
    amount: 93,
    expirationDate: '2024-05-02'
}

const otherItemA = {
    placeholderID: '22000023',
    amount: 15,
    expirationDate: '2024-05-22'
}

const items = [verbandItemA, verbandItemB, verbandItemC, otherItemA];
const placeholders = [verbandPlaceholder, otherPlaceholder];

const filterPlaceholders = (placeholders, searchTerm, searchType) => {
    if (searchType === 'name') {
        return placeholders.filter(placeholder =>
            placeholder.name.toLowerCase().includes(searchTerm.toLowerCase())
        );
    } else if (searchType === 'id') {
        return placeholders.filter(placeholder =>
            placeholder.id.toString().toLowerCase().includes(searchTerm.toLowerCase())
        );
    }
};

const Stock = () => {
    const [searchTerm, setSearchTerm] = useState('');
    const [searchType, setSearchType] = useState('name');

    // Filter placeholders based on search term and type
    const filteredPlaceholders = filterPlaceholders(placeholders, searchTerm, searchType);

    return (
        <div className="select-none">
            <h1>Only a Work in Progress</h1>
            <h3>The data below is just a placeholder, the buttons are not functional yet</h3>
            <h7>Red means that:</h7>
            <ul>
                <li>The amount is 0</li>
                <li>An Item is expired</li>
            </ul>
            <h7>Yellow means that:</h7>
            <ul>
                <li>The minimum amount has not been reached</li>
                <li>An Item is not about to expire</li>
            </ul>
            <SearchBar
                searchTerm={searchTerm}
                setSearchTerm={setSearchTerm}
                searchType={searchType}
                setSearchType={setSearchType}
            />
            {filteredPlaceholders.map((placeholder, index) => (
                <React.Fragment key={index}>
                    <ItemCard items={items} placeholder={placeholder} />
                </React.Fragment>
            ))}
        </div>
    );
};

export default Stock;

const SearchBar = ({ searchTerm, setSearchTerm, searchType }) => {
    return (
        <Form className="mb-3">
            <InputGroup className="mb-3">
                <FormControl
                    type="text"
                    placeholder={`Search items by ${searchType}...`}
                    value={searchTerm}
                    onChange={(e) => setSearchTerm(e.target.value)}
                />
            </InputGroup>
        </Form>
    );
};